#include<iostream>
#include<string>
#include<vector>

using namespace std;

class Solution {
public:
    int lengthOfLongestSubstring(string s) {
        int ans = 0;
        for (int i = 0; i < s.length(); ++i)
        {
        	vector<bool> flag(256, false);
        	int j;
        	for (j = i; j < s.length(); ++j)
        	{
	        	if (!flag[s[j] - '0'])
	        	{
	        		flag[s[j] - '0'] = true;
	        	}
	        	else 
	        	{	
	        		break;
	        	}
	        }
	        if (j - i > ans)
       		{
       			ans = j - i;
        	}
        }
        return ans;
    }
};

